import React, { useState } from "react";
import {Product} from "./product";
import productData from "./productData";
import {AddPage} from "./addPage";

export const Body = () =>{
    const productModal = productData.map(
        item => {
            return (

                <Product
                    key = {item.id}
                    list = {item}
                />

            )
        }
    )

    const [pop, setPop] = useState("false")
    const Page = () =>{
        setPop((element) => element = !element)
        console.log(pop)
    }

    return (
        <div className="body">
            <div className="add" onClick={Page}>新增产品</div>
            {pop ? <AddPage /> : null}
            {productModal}
        </div>
    )
}
